import React from "react";
import AddUserForm from "../../FormComponent/AirportForm/AddAirport";

const CreateAirports = () => {
  return (
    <div>
      <div
        style={{
          backgroundColor: "#FFFFFF",
          minWidth: "400px",
          maxWidth: "400px",
        }}
      >
        <h3
          style={{
            textAlign: "center",
            marginTop: "10vh",
            marginBottom: "3vh",
          }}
        >
          CREATE AIRPORTS
        </h3>
        <AddUserForm />
      </div>
    </div>
  );
};
export default CreateAirports;
